        channelId: "",
        code: "",
        customerId: "",
        institutionId: "",
        mobileNumber: state.mobnumber ? state.mobnumber : "",
        otac: "",
        otp: state.OTPNumber ? state.OTPNumber : "",
        otpId: state.otpId ? state.otpId : "",
        refId: "",
        referenceNumber: "",
      };

      await this.apiFetchEdit("api/v1/otp/validate", body, "validate");
      // this.setState({ query: "progress" });
      if (this.state?.resCode !== "00") {
        this.setState({ query: "success" });
      } else {
        this.setState({ query: "progress" });
      }
    }
  };
  componentDidMount = async () => {
    debugger;
    //  firstName: " ",
    //   midname: " ",
    //   lastname: "",
    //   email: "",
    //   phone: "",
    //   mobile: "",
    const state = this.state;

    const val = this.context.channel?.customerEnquiryRes?.custDetailsResp?.[0] || this.context.channel;
    const tab = val?.accountDetailsResp?.map((v) => {
      v.AccountNumber = v.accNo;
      v.cardNo = v.cardDetailsResp?.[0]?.vpan;
      v.cardStatus = v.cardDetailsResp?.[0]?.cardStatus;
      v.BranchCode = v.branchCode;
      v.ProductType = v.cardDetailsResp?.[0]?.cardProduct;
      v.ProductName = v.cardDetailsResp?.[0]?.cardProductDesc;
      v.ExpirationDate = v.cardDetailsResp?.[0]?.expDate;
      return v;
    });
    this.setState({
      cardNO: val?.cardNo,
      cardstatus: val?.cardStatus,
      cardType: "",
      cardProd: val?.accountDetailsResp?.[0]?.cardDetailsResp?.[0]?.cardProduct,
      mobnumber: val?.mobNo,
      firstName: val?.firstName,
      lastname: val?.lastName,
      mobile: val?.mobNo,
      email: val?.emailId,
      phone: val?.workTel,
      dob: val?.dateOfBirth,
      data: tab,
    });
    const body = {
      instCode: loginUser?.[0]?.instCode,
      pan: "",
      pflag: "s",
      reqMsgId: "",
      vpan: val?.accountDetailsResp?.[0]?.cardNo,
    };
    await this.apiFetchEdit("api/v1/enquiry/carddetails", body);
  };
  handlesubmit = async () => {
    // if (this.validate()) {
    const state = this.state;

    const body = {
      approverId: "",
      channelAccessDetails: {
        domAtm: "Y",
        domPos: "Y",
        domEcom: "Y",
        domConless: "Y",
        intlAtm: "Y",
        intlPos: "Y",
        intlEcom: "Y",
        intlConless: "Y",
      },
      checkerId: "",
      flag: "s",
      instCode: loginUser?.[0]?.instCode,
      limitDetails: {
        domAtmLimit: "1000",
        domPosLimit: "1000",
        domEcomLimit: "1000",
        domConlessLimit: "1000",
        intlAtmLimit: "1000",
        intlPosLimit: "1000",
        intlEcomLimit: "1000",
        intlConlessLimit: "1000",
      },
      makerId: "",
      pan: "",
      reqMsgId: "",
      vpan: "PMMG000000000012",
    };
    await this.apiFetchEdit("api/v1/cardlimitandchannel", body, "submit");
    // }
  };

  handledata = () => { };
  handlechange = (n, v) => {
    debugger
    const state = this.state;
    state.error[n] = false;
    this.setState({
      ...state,
      [n]: v,
    });
  };
  handleDownload = () => {
    const state = this.state;
    this.setState({
      ...state,
      download: !state.download,
    });
  };
  render() {
    const { classes, mobnumber } = this.props;
    const { query, error, OTPNumber } = this.state;

    return (
      <div className={classes.root}>
        <Container>
          <Card className={classes.card}>
            <Container>
              <div className={classes.body}>
                <CardContent className={classes.card_title}>
                  Cardholder Details
                </CardContent>
                <Grid container spacing={4} style={{ marginTop: "20px" }}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      First Name
                    </Typography>
                    <TextField
                      value={this.state.firstName}
                      name="firstName"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange("firstName", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Middle Name
                    </Typography>
                    <TextField
                      value={this.state.midname}
                      name="midname"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange("midname", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Last Name
                    </Typography>
                    <TextField
                      value={this.state.lastname}
                      name="lastname"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange("lastname", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Email Address
                    </Typography>
                    <TextField
                      value={this.state.email}
                      name="email"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange("email", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Phone Number
                    </Typography>
                    <TextField
                      value={this.state.phone}
                      name="phone"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange("phone", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Mobile Number
                    </Typography>
                    <TextField
                      value={this.state.mobile}
                      name=" Mobile"
                      size="small"
                      disabled
                      onChange={(e) =>
                        this.handlechange(" mobile", e.target.value)
                      }
                      variant="outlined"
                      placeholder=""
                      className={classes.TextField}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Date of Birth
                      </Typography>
                      <KeyboardDatePicker
                        style={{ width: "100%", margin: 0 }}
                        inputVariant="outlined"
                        margin="normal"
                        format="MM/dd/yyyy"
                        // disabled={checkerDisabled ? true : false}
                        value={this.state.dob}
                        name="dob"
                        maxDate={new Date()}
                        onChange={(e) => this.handlechange("dob", e)}
                        placeholder="Date of Birth"
                        onKeyPress={(e) => this.dateval(e)}
                        KeyboardButtonProps={{
                          "aria-label": "change date",
                        }}
                        size="small"
                      />
                    </MuiPickersUtilsProvider>
                  </Grid>
                </Grid>

                <div style={{ marginTop: "20px" }}>
                  <CardContent className={classes.card_title}>
                    Card Details
                  </CardContent>

                  <MaterialTable
                    // title="Search Results"
                    title={false}
                    options={{
                      search: false,
                      sorting: true,
                      pageSize: 1,
                      pageSizeOptions: [5, 10, 50, 100, 200],
                      actionsColumnIndex: -1,
                      rowStyle: (rowData) => ({
                        backgroundColor:
                          rowData.tableData.id % 2 === 0 && "#F8F8FA",
                      }),
                    }}
                    columns={[
                      {
                        field: "AccountNumber",
                        title: "Account Number",
                      },
                      {
                        field: "cardNo",
                        title: "Card Number",
                      },
                      {
                        field: "cardStatus",
                        title: "Card Status",
                      },

                      {
                        field: "BranchCode",
                        title: "Branch Code",
                      },
                      {
                        field: "ProductType",
                        title: "Product Type",
                      },
                      {
                        field: "ProductName",
                        title: "Product Name",
                      },
                      {
                        field: "ExpirationDate",
                        title: "Expiration Date",
                      },
                    ]}
                    data={this.state.data}
                  // actions={[
                  //   (rowData) => ({
                  //     icon: () => (
                  //       <VisibilityIcon
                  //         onClick={() => this.handledata()}
                  //         fontSize="small"
                  //         style={{ color: "#728691" }}
                  //       />
                  //     ),

                  //     tooltip: "View",
                  //   }),
                  // ]}
                  />
                </div>
                <div style={{ marginTop: "20px" }}>
                  <CardContent className={classes.card_title}>
                    Channel Enablement and Limit Management
                  </CardContent>

                  <Grid container>
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={3}
                      xl={3}
                      style={{ width: "50%", marginTop: "125px" }}
                    ></Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={9}
                      lg={9}
                      xl={9}
                      style={{ display: "flex", paddingLeft: "42px" }}
                    >
                      <Grid item xs={12} sm={5} spacing={2}>
                        <Grid item xs={12} sm={12}>
                          <Typography
                            variant="subtitle2"
                            className={classes.text_title}
                          >
                            Existing Limit
                          </Typography>
                          <TextField
                            value={this.state.existlimit}
                            name="existlimit"
                            size="small"
                            style={{ width: "90%" }}
                            disabled
                            onKeyPress={(e) => {
                              this.txtFieldChange(e);
                            }}
                            onChange={(e) =>
                              this.handlechange("existlimit", e.target.value)
                            }
                            variant="outlined"
                            placeholder="50,000"
                            className={classes.TextField}
                          />
                        </Grid>
                        <Grid
                          item
                          xs={12}
                          sm={12}
                          style={{ width: "90%", marginTop: "40px" }}
                        ></Grid>
                      </Grid>
                      <Grid item xs={12} sm={7}>
                        <Grid item xs={12} sm={12} spacing={2}>
                          <Typography
                            variant="subtitle2"
                            className={classes.text_title}
                          >
                            Set New Limit
                          </Typography>
                          <TextField
                            value={this.state.setnew}
                            name="setnew"
                            size="small"
                            style={{ width: "70%" }}
                            onKeyPress={(e) => {
                              this.txtFieldChange(e);
                            }}
                            onChange={(e) =>
                              this.handlechange("setnew", e.target.value)
                            }
                            variant="outlined"
                            placeholder=""
                            className={classes.TextField}
                          />
                        </Grid>

                        <Grid item xs={12} sm={12}>
                          <Grid
                            item
                            xs={12}
                            sm={12}
                            style={{ width: "90%", marginTop: "40px" }}
                          ></Grid>
                        </Grid>
                      </Grid>
                    </Grid>

                    <Grid item xs={12} sm={12} spacing={2}>
                      <MaterialTable
                        // title="Search Results"
                        title={false}
                        options={{
                          search: false,
                          sorting: true,
                          pageSize: 8,

                          actionsColumnIndex: -1,
                          rowStyle: (rowData) => ({
                            backgroundColor:
                              rowData.tableData.id % 2 === 0 && "#F8F8FA",
                          }),
                        }}
                        columns={[
                          {
                            field: "EnableDisableChannels",
                            title: "Enable/Disable",
                          },
                          {
                            field: "ChannelNames",
                            title: "Channels",
                          },
                          {
                            field: "Daily",
                            title: "Daily",
                          },
                          {
                            field: "Weekly",
                            title: "Weekly",
                          },
                          {
                            field: "Monthly",
                            title: "Monthly",
                          },
                          {
                            field: "DailyEd",
                            title: "Daily",
                          },
                          {
                            field: "WeeklyEd",
                            title: "Weekly",
                          },
                          {
                            field: "MonthlyEd",
                            title: "Monthly",
                          },
                        ]}
                        data={this.state.data4}
                      />
                    </Grid>
                  </Grid>

                  <Grid container>
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={3}
                      xl={3}
                      style={{ width: "50%", marginTop: "125px" }}
                    >
                      {/* <MaterialTable
                            // title="Search Results"
                            title={false}
                            options={{
                              search: false,
                              sorting: true,
                              pageSize: 6,
                              pageSizeOptions: [5, 10, 50, 100, 200],
                              actionsColumnIndex: -1,
                              rowStyle: (rowData) => ({
                                backgroundColor:
                                  rowData.tableData.id % 2 === 0 && "#F8F8FA",
                              }),
                            }}
                            columns={[
                                {
                                    field: 'EnableDisableChannels',
                                    title: 'Enable/Disable Channels'
                                  },
                              {
                                field: 'ChannelNames',
                                title: 'Channel Names'
                              },
                             
                              
                            ]}
                             
                            data={this.state.data1}
                            
                           
                          /> 
                       */}
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={9}
                      lg={9}
                      xl={9}
                      style={{ display: "flex", paddingLeft: "42px" }}
                    >
                      <Grid item xs={12} sm={5} spacing={2}>
                        <Grid item xs={12} sm={12}>
                          <Typography
                            variant="subtitle2"
                            className={classes.text_title}
                          >
                            Total
                          </Typography>
                          <TextField
                            value={this.state.total1}
                            name="total1"
                            size="small"
                            style={{ width: "90%" }}
                            disabled
                            onKeyPress={(e) => {
                              this.txtFieldChange(e);
                            }}
                            onChange={(e) =>
                              this.handlechange("total1", e.target.value)
                            }
                            variant="outlined"
                            placeholder="50,000"
                            className={classes.TextField}
                          />
                        </Grid>
                      </Grid>
                      <Grid item xs={12} sm={7}>
                        <Grid item xs={12} sm={12} spacing={2}>
                          <Typography
                            variant="subtitle2"
                            className={classes.text_title}
                          >
                            Total
                          </Typography>
                          <TextField
                            value={this.state.total2}
                            name="total2"
                            size="small"
                            style={{ width: "70%" }}
                            disabled
                            onKeyPress={(e) => {
                              this.txtFieldChange(e);
                            }}
                            onChange={(e) =>
                              this.handlechange("total2", e.target.value)
                            }
                            variant="outlined"
                            placeholder="51,000"
                            className={classes.TextField}
                          />
                        </Grid>
                      </Grid>
                    </Grid>
                  </Grid>
                </div>

                <Grid container spacing={4} style={{ marginTop: "30px" }}>
                  <Grid item container xs={12} sm={6} spacing={4}>
                    <Grid item xs={12} sm={12} md={7} lg={10}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Mobile number
                      </Typography>
                      <TextField
                        value={this.state.mobile}
                        size="small"
                        variant="outlined"
                        disabled
                        placeholder=""
                        onChange={(e) =>
                          this.handleChange("mobnumber", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={6}
                      md={5}
                      lg={2}
                      className={classes.buttons}
                    >
                      <Button
                        className={classes.clear}
                        onClick={() => this.handleOtp("otp")}
                      >
                        Send OTP
                      </Button>
                    </Grid>
                  </Grid>
                  <Grid
                    item
                    container
                    xs={12}
                    sm={6}
                    spacing={2}
                    className={classes.otpbox}
                  >
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={6}
                      lg={9}
                      className={classes.enterOTP}
                    >
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter OTP Number
                      </Typography>
                      <TextField
                        size="small"
                        variant="outlined"
                        style={{ width: "100%" }}
                        placeholder="OTP Number"
                        className={classes.input}
                        onKeyPress={(e) => {
                          this.txtFieldChange(e);
                        }}
                        inputProps={{
                          maxLength: 6
                        }}
                        helperText={error?.OTPNumber && "Please enter otp"}
                        error={error?.OTPNumber && true}
                        onChange={(e) => {
                          this.handlechange("OTPNumber", e.target.value);
                        }}
                        value={this.state.OTPNumber}
                      />
                      {this.state.errdata ? <Button
                        size='small'
                        style={{
                          marginTop: "10px",
                          backgroundColor: "green",
                          color: "white"
                        }}
                      >Invaild OTP number</Button> : "" || query === "success" ? (
                        <>
                          <Fab aria-label="save" size="small" color="primary">
                            <CheckIcon />
                          </Fab>
                          OTP verfied successfully!
                        </>
                      ) : (
                        <Fade
                          in={query === "progress"}
                          style={{
                            transitionDelay:
                              query === "progress" ? "800ms" : "0ms",
                          }}
                          unmountOnExit
                        >
                          <CircularProgress size="2rem" />
                        </Fade>
                      )}
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={6}
                      lg={3}
                      className={classes.enterOTP1}
                    >
                      <Button
                        disabled={this.state.disabled}
                        className={classes.clear1}
                        onClick={() => this.handleOtpvalidate()}
                      >
                        validate
                      </Button>
                    </Grid>

                    <Grid item xs={12} sm={6} style={{ paddingTop: "0px" }}>
                      <Hidden xsUp>Enter OTP Number</Hidden>
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={6}
                      className={classes.enterOTP1}
                      style={{ paddingTop: "0px" }}
                    >
                      <Typography
                        onClick={() => this.handleOtp("resend")}
                        variant="subtitle2"
                        className={classes.hint_title2}
                      >
                        Resend OTP
                        <ArrowRightIcon
                          style={{ position: "relative", top: "7px" }}
                        />
                      </Typography>
                    </Grid>
                  </Grid>

                  <Grid
                    container
                    direction="row"
                    justify="space-between"
                    alignItems="end"
                    className={classes.btns}
                  >
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      className={classes.submitbotton}
                      style={{ textAlign: "end", marginRight: "50px" }}
                    >
                      <Button
                        variant="contained"
                        disabled={this.state.disableVal}
                        className={classes.submit1}
                        onClick={() => this.handlesubmit()}
                      >
                        SUBMIT
                      </Button>
                      <Button
                        className={classes.clear2}
                        onClick={() => this.handleClear()}
                      >
                        CLEAR
                      </Button>
                    </Grid>
                  </Grid>
                </Grid>
              </div>
            </Container>
          </Card>
          <div style={{ float: "right" }}>
            <Button
              variant="contained"
              color="primary"
              size="medium"
              className={classes.btn}
              onClick={() => this.handleBack()}
            >
              <KeyboardBackspaceIcon /> Back
            </Button>
          </div>
        </Container>
      </div>
    );
  }
}
Limit.contextType = EdittablesContext;
export default withStyles(styles)(withRouter(Limit));
